import React from 'react'
import ToDo from './ToDo'

const ToDoList = ({toDoes, options}) => {

    console.log(toDoes)

    if (toDoes[0] !== undefined) {
  return (
    <ul className='toDoList'>
        {toDoes.map((Todo) => (
            <ToDo 
            key={Todo.todo_id}
            Todo={Todo}
            options={options}/>
        ))}
    </ul>
  )
}
}

export default ToDoList
